(11382,514,514,3,1,5.0000,'Тестовое задание. Игра Factorio:\r\nЦель\r\nНужно построить производственную линию, которая будет изготавливать 30 железных плит в секунду (можно в режиме песочницы, можно в компании, можно в свободной игре). Технологии для производства можно брать любые. \r\n\r\nРезультат:\r\n1. Напишите пожалуйста отчет, как можно определить, что линия и вправду производит 30 единиц железных плит в секунду.\r\n2. Сделайте пожлауйста чертеж Вашего производства и приложите к отчету\r\n\r\nСрок выполнения - до четверга, 16.06.2022 до 12:00','Джобс С.',4,0,180,100,'2025-01-14 00:00:00','2022-06-15 19:52:09',0,0,0,'2022-05-01','2022-05-31'),
