CREATE DEFINER=`root`@`localhost` FUNCTION `saveTokenRefreshJWT`(newTokenHash VARCHAR(64), prevTokenHash VARCHAR(64), ipv4Str VARCHAR(15), userAgent VARCHAR(1000), expireAt DATETIME, userId INT UNSIGNED, familyUid UUID) RETURNS uuid
BEGIN
	DECLARE tokenUid UUID;
	SET tokenUid = UUID();
		
	IF prevTokenHash IS NULL THEN
		IF familyUid IS NULL THEN
			SET familyUid = UUID();
		END IF;
		
	ELSE		
		SET familyUid = (SELECT family_id FROM token_refresh_jwt WHERE tokenHash=prevTokenHash);
		UPDATE token_refresh_jwt SET used_at = now() WHERE tokenHash=prevTokenHash;
	END IF;

	IF familyUid IS NULL THEN
		RETURN null;
	END IF;
	
	UPDATE token_refresh_family SET expire_at=expireAt WHERE id=familyUid;
	RETURN tokenUid;
END ;;
